import React, { Component } from 'react';

import CartItem from './CartItem/CartItem';

class Cart extends Component {
    render () {
        console.log(this.props.itemsInCart)
        let elements = []

        this.props.itemsInCart(product => {
            elements.push(
            <CartItem
                key={product.id}
                product={product}
                onClick={this.props.onClick}/>
            )
        })
        return (
            <div>
                {elements}
            </div>
        );
    }
}

export default Cart;
